(function() {
    'use strict';

    // window.addEventListener('keydown',function(e){
    var style=document.createElement('style')
    style.innerText=`
    .ant-menu-dark.ant-menu-inline, .ant-menu-dark.ant-menu-vertical, .ant-menu-dark.ant-menu-vertical-left, .ant-menu-dark.ant-menu-vertical-right{
        background-color: rgba(59, 64, 75, 0.4);
    }
    .ant-layout-sider{
        background-color: rgba(59, 64, 75, 0.5);
    }
    .ant-menu-dark .ant-menu-inline.ant-menu-sub{/*侧边栏单项展开*/
        background-color: rgba(59, 64, 75, 0.5);
    }
    .ant-menu-dark.ant-menu-dark:not(.ant-menu-horizontal) .ant-menu-item-selected{/*“首页元素样式1”*/
        background-color: rgba(37, 40, 49, 0.6);
    }
    .ant-menu-submenu-popup.ant-menu-dark .ant-menu-item-selected, .ant-menu.ant-menu-dark .ant-menu-item-selected{/*“首页元素样式2”*/
        background-color: rgba(37, 40, 49, 0.6);
    }
    .eVZOuv{/*“切换学期”元素样式*/
        background-color: rgba(49, 54, 64, 0.7);
    }
    .ant-layout.ant-layout-has-sider>.ant-layout, .ant-layout.ant-layout-has-sider>.ant-layout-content{/*除侧边栏外其他部分section——或——页面上第二个section*/
        background-color: rgba(255, 255, 255, 0);
    }
    .ant-layout-content{
        opacity:0.9;
    }
    .ant-layout-header{
        background-color: rgba(255, 255, 255, 0.9) !important;
    }
    .ant-layout.ant-layout-has-sider{/*页面上第一个section——或——全部元素的section*/
        background-size: contain;
        background-repeat: no-repeat;
        background-image:url(data:image/jpeg;base64,)
    }

    .ilZRCA{/*健康监测-晨检*/
        background-color: rgba(255, 255, 255, 1);
        padding-top: 20px;
        padding-bottom: 9px;
        padding-left: 15px;
        border-radius: 6px;
        margin-bottom: -10px;
    }
    .jCKeld.jCKeld.jCKeld{/*行政班-路径*/
        padding-bottom: 9px;
        border-bottom-left-radius: 6px;
        border-bottom-right-radius: 6px;
        background-color: rgba(255, 255, 255, 0.9);
        padding-top: 17px;
        padding-left: 25px;
        border-top-left-radius: 6px;
        border-top-right-radius: 6px;
        margin: unset;
        margin-top: 15px;
    }
    .inSevB{/*行政班-标题*/
        margin-bottom: unset;
    }
    `
    document.body.appendChild(style)

    var ppp=''
    var type=0
    window.addEventListener('keydown',function(e){
        if(e.ctrlKey!=true&&type==0){
            if(ppp.length>20){
                ppp=ppp.substr(2)
            }
            ppp=ppp+e.keyCode
            // console.log(ppp)
            if(ppp.match("6589657565")!=null){
                // alert('a')
                var all=document.getElementsByTagName('section')[0]
                all.childNodes[0].style.visibility='hidden'
                all.childNodes[1].style.visibility='hidden'
                ppp=''
                type=1
            }
        }
        else if(type==1&&e.keyCode==27){
            all=document.getElementsByTagName('section')[0]
            all.childNodes[0].style.visibility='visible'
            all.childNodes[1].style.visibility='visible'
            type=0
        }
    })

    new MutationObserver(mutations => {
        for(var i=0;i<mutations.length;i++){
            if(mutations[i].addedNodes.length!=0){
                // if(mutations[i].addedNodes[0].src!=null){
                // }
                // console.log(mutations[i].addedNodes[0])
                if(mutations[i].addedNodes[0].tagName=='SECTION'){
                    var top=mutations[i].addedNodes[0].childNodes[1].childNodes[1].childNodes[1].childNodes[0].childNodes[0]
                    var bottom=mutations[i].addedNodes[0].childNodes[1].childNodes[1].childNodes[1].childNodes[0].childNodes[1]
                    if(top.innerText.match(/首页\//)!=null&&bottom.getElementsByTagName('svg')!=null){
                        top.style=`background-color: rgba(255, 255, 255, 1);padding-top: 17px;padding-left: 11px;padding-left: 25px;border-top-left-radius: 6px;border-top-right-radius: 6px;margin: unset;margin-top: 15px;`
                        bottom.style=`background-color: rgba(255, 255, 255, 1);padding-top: 20px;padding-bottom: 17px;padding-left: 15px;border-bottom-left-radius: 6px;border-bottom-right-radius: 6px;margin-bottom: 20px;`
                    }
                    // console.log(mutations[i].addedNodes[0].childNodes[1].childNodes[1].childNodes[1].childNodes[0].childNodes[0])
                }
                else if(mutations[i].addedNodes[0].dataset.testId=='页面布局'){
                    top=mutations[i].addedNodes[0].childNodes[0]
                    bottom=mutations[i].addedNodes[0].childNodes[1]
                    if(top.innerText.match(/首页\//)!=null&&bottom.getElementsByTagName('svg')!=null){
                        top.style=`background-color: rgba(255, 255, 255, 1);padding-top: 17px;padding-left: 11px;padding-left: 25px;border-top-left-radius: 6px;border-top-right-radius: 6px;margin: unset;margin-top: 15px;`
                        bottom.style=`background-color: rgba(255, 255, 255, 1);padding-top: 20px;padding-bottom: 17px;padding-left: 15px;border-bottom-left-radius: 6px;border-bottom-right-radius: 6px;margin-bottom: 20px;`
                    }
                }

            }
        }
    }).observe(document.body, {childList: true, subtree: true})
})();